(270, 205, 134, 'Hi Lukas\nWhat a wonderful page! I am very happy to discover this. I hope that it becomes very popular. I think I will add a few tags. I found the map because I am studying GIS and am a passionate vegetable gardener. I want to map all of the potential land for urban agriculture, divided into Municipalities, in the hope of inspring communities, reducing food miles and creating happiness. I have also made a small preliminary map of existing sites with links, before I knew about this or the VEIL map. It is just a small test map. Would you like to see it? I am wondering, when the VictoriaMyCommunity becomes heavily used with a lot of placetags added, will the placetags overpower the map? or will you make them smaller/scale sensitive? Great project! Let me know if you are intersted in looking at my little map and I will send it. Its only a HTML file at this stage. Mu number is 0408553217\nAlison Lobbe', '2012-09-06 05:08:49'),
(271, 205, 134, 'oh and my regular email is alisonlobbe@gmail.com', '2012-09-06 05:12:04'),
