INSERT INTO `marker` (`marker_id`, `alt_contact_on`, `alt_contact_email`, `alt_contact_url`, `alt_contact_text`, `address`, `phone`, `title`, `description`, `type`, `subtype`, `subtype_id`, `lat`, `lng`, `www`, `wiki`, `rss`, `kml_on`, `datetime_on`, `is_demo`, `start_datetime`, `end_datetime`, `tags`, `last_updated`, `deleted`) VALUES
(127, 1, '', '', '', '', '', 'Fridge (Works OK) DEMO ONLY', 'Just got a new energy efficient fridge, so dont need this one any more, still works ok, but the seal is a little broken at the bottom, but otherwise is fine       will this work?', 'resource', 'freecycle', 8, -37.794998, 144.983994, '', '', '', 0, 0, 'y', '9999-01-01 00:00:00', '9999-01-01 00:00:00', 'free', '2010-05-18 22:00:58', 0),
(7651, 1, '', 'http://www.thebikeshed.org.au/', '', '', '', 'The Bikeshed at CERES ', 'The BikeShed is a volunteer on-site group at CERES in Melbourne. Our aim is to promote cycling in the local community by teaching people how to fix their own bikes. Membership of the BikeShed is $10 per year, or $5 for students and concession card holders.', 'resource', 'bike facility', 10, -37.766308829813, 144.98346358538, 'http://www.thebikeshed.org.au/', '', '', 0, 0, 'n', '9999-01-01 00:00:00', '9999-01-01 00:00:00', '', '0000-00-00 00:00:00', 0),
(130, 0, 'undefined', '', '', '', '', 'Kitchen Table DEMO ONLY', 'square kitchen table, wooden, good condition besides a wobbly leg, would be good for someone to repair, I just don\\''t have the time to do so.  If you want it, its yours.', 'resource', 'freecycle', 8, -37.783798, 144.970993, '', '', '', 1, 0, 'y', '9999-01-01 00:00:00', '9999-01-01 00:00:00', 'table, furniture ', '2010-05-18 22:01:22', 0),
(123, 0, '', '', '', '', '', '(DEMO ONLY) Start a community garden? ', 'Hey, this end of this park would be great to start a community garden, anyone interested?????   A friend of mine has started one in Brunswick and it is going well, the council was happen for them to use similar land, so if you\\''re interested drop me a line, if a few people are interested, we could get together and discuss aproaching the council...', 'community', 'note', 3, -37.789501, 144.973999, '', '', '', 0, 0, 'y', '9999-01-01 00:00:00', '9999-01-01 00:00:00', 'frogs', '0000-00-00 00:00:00', 0),
