(7462, 0, '', '', '', '', '', 'Merri Corner Community Garden', 'In mid 2007, a group of local residents met with the intention to turn a patch of grass into a community garden. It presented itself as a solution to the lack of garden space within the medium density housing surrounding it, and a space for food production for the greater community. By early 2009 the group has become incorporated , applied for grants and jumped many bureaucratic hurdles with the assistance of Sustainability Streets Moreland. The proposed garden will consist of around 16 individual plots, communal composting, espaliered fruit trees, sensory gardens, a community meeting space and shelter and native plantings, all in line with permaculture principles. ', 'food', 'community garden', 6, -37.759700775146, 144.98100280762, 'http://www.merricorner.org', '', '', 0, 0, 'n', '9999-01-01 00:00:00', '9999-01-01 00:00:00', '', '2010-05-18 20:05:56', 0),
