(7714, 1, 'longhaven@iinet.net.au', '', '', '', '', 'LongHaven orchard', 'Mainly apples (some pears).  Used to be BIG grower in family partnership (supplying supermarkets and canneries).  Now smaller, independent.  Travels to melborne a bit for markets Feb - june.  Donates some a to salvo and handover centre accomadation crisis centre in the city.  Involved in School program to promote Aussie Apples.  Make hampers with local gourmet products.  Also does preserves, jams.  Sells jams and spreads to Melbourne Food Depot.  Sells some at friends farm gate.  Family orchid is still BIG and they sell to ALDI. Address: 86 McPherson Rd Mundoona 3635. 10,001 - 10 hectares.\n\n', 'food', 'farm', 14, -36.157113, 145.33179, '', '', '', 0, 0, 'n', '9999-01-01 00:00:00', '9999-01-01 00:00:00', '', '0000-00-00 00:00:00', 0),
