(8416, 1, 'tom@cultivatingcommunity.org.au', 'http://cultivatingcommunity.org.au', '', 'Napier Street, Fitzroy, Victoria', '9415 6580', 'Atherton Gardens', 'The Atherton Gardens estate consists of four high rise tower blocks, two situated in Brunswick Street between Gertrude and King William streets (blocks 90 and 140) and two situated in Napier Street (blocks 95 and 125). Each tower block comprises 200 flats (10 flats on each floor x 20 floors per block) making a total of 800 high rise units. Directly opposite block 95, at 100 Napier Street there are 24 walk-up flats, another 24 (approx) located on the corner of George and Condell Streets, 8 townhouses in Moor Street (opposite the Fitzroy Library) and an additional 60 (approx) walk-ups located in St Laurence estate, bordered by Feet and Hannover Streets. These include 8 elderly person\\''s units at 45 Fleet Street. The estimated overall population is approximately 3,000 residents.', '', '', 6, -37.8031721269745, 144.979405403137, '', '', '', 0, 0, 'n', '9999-01-01 00:00:00', '9999-01-01 00:00:00', NULL, '2011-01-17 05:29:16', 0),
