(8419, 1, 'peter.j.scott@roads.vic.gov.au', '', '', 'Cnr Roberts and Stewart Streets, Brunswick East, Victoria, 3057', '(03) 9389 0100 ', 'CERES Community Garden', 'There are about 50 community garden plots at CERES which are rented out yearly to those with limited household space for growing.\n\nThe community gardens has regular working bees and social BBQs. These are great opportunities for gardeners to mingle, share freshly grown produce, swap seeds and pitch in to help maintain the site.', '', '', 6, -37.766109518787, 144.982978105545, 'http://www.ceres.org.au/node/26', '', '', 0, 0, 'n', '9999-01-01 00:00:00', '9999-01-01 00:00:00', NULL, '2011-01-17 05:49:16', 0),
