(8440, 0, '', '', '', 'Cnr Liardet and Nott Streets  Port Melbourne, VIC, 3207  ', '03 9645 1476 ', 'Port Melbourne Neighbourhood House', 'Port Melbourne Neighbourhood House manages 2 community gardens. One at Fisherman\\''s Bend Community Centre,  cnr of Dunstan Parade and Centre Avenue, Garden City is one of Port Phillip\\''s vibrant community gardens. Port Phillip\\''s second community garden is located at the west end of JLMurphy Reserve, Williamstown Road, Port Melbourne. It consists of raised, vegetable garden plots and includes wheelchair accessible facilities.', '', '', 6, -37.8378594, 144.9412355, 'http://www.portphillip.vic.gov.au/community_gardens.htm', '', '', 0, 0, 'n', '9999-01-01 00:00:00', '9999-01-01 00:00:00', NULL, '2011-01-27 22:49:33', 0),
(8441, 1, '', 'http://www.vegout.asn.au/contact.html', '', '', '', 'Veg Out Community Gardens St Kilda', 'Veg Out is an organic, chemical free garden run by volunteers. Formerly a lawn bowling green, the land Veg Out is situated on is administered by the local council for the State of Victoria, and has been permanently reserved for public use since 1881. We have over 140 plots, where members, friends, families and community groups enjoy getting their hands into the soil. Many have little or no gardening experience, but they soon learn as advice, seedlings and friendships are readily shared.', '', '', 6, -37.8681005, 144.9778716, 'http://www.vegout.asn.au', '', '', 0, 0, 'n', '9999-01-01 00:00:00', '9999-01-01 00:00:00', NULL, '2011-01-27 22:53:09', 0),
