(8451, 0, '', '', '', 'Gillespie Rd, ST ALBANS, Vic', '', 'Kings Patch', 'School Garden\nestablished 2002. Very successful, low budget project, fully integrated into sustainable environmental education curricula.\nvegies, herbs, fruit trees.  Used by students, staff\n', '', '', 6, -37.7347065, 144.7856445, '', '', '', 0, 0, 'n', '9999-01-01 00:00:00', '9999-01-01 00:00:00', NULL, '2011-03-06 04:08:07', 0),
(8450, 0, '', '', '', 'Vincent Avenue ST ALBANS.  Melway 14 C12 ', '9249 4854 or 03 9249', 'Padley Park Community Garden', 'This garden is located in the heart of St Albans and is situated in a residential area within public parkland. It has a very open, sunny aspect and all of the plots are relatively large. Since its establishment in 1993 it has grown from 12 plots to 32 plots and continues to be popular with the local residents. Community gardens enable residents and organisations who have limited gardening opportunities the ability to produce their own fresh vegetables. Keen gardeners who live in Brimbank can rent a plot for a fee of $62.40 payable each year. Membership is limited to one plot per household. Facilities are also available for gardeners with a disability who meet the eligibility requirements', '', '', 6, -37.741579, 144.8093262, 'http://www.brimbank.vic.gov.au/Page/Page.asp?Page_Id=176&amp;h=1', '', '', 0, 0, 'n', '9999-01-01 00:00:00', '9999-01-01 00:00:00', NULL, '2011-03-06 04:01:16', 0),
